INSERT INTO `article_info` VALUES (1,'PBlog安装使用说明','PBlog是一款使用Java开发的、以markdown作为文章写作语法的单页应用blog，目的是供作为学习交流使用，也可以用来构建个人网站。\r\n\r\n本文描述作为项目安装使用说明，由于论文答辩以及琐事，尚有一部分功能未能够实现，会在以后慢慢完善。欢迎提交 <em>Pr</em> 以及 <em>Issue</em>\r\n\r\n[view this project on github](https://github.com/penglongli/PBlog)\r\n\r\n## 简介\r\nPBlog基于<em>Spring Framework</em> + <em>Mybatis</em>，前端使用 <em>Less</em> 作为预处理样式， <em>marked.js</em> 来处理markdown格式内容，并且通过 <em>AngularJS</em> 控制视图跳转实现PC端单页应用， <em>gulp</em> 作为前端自动化构建工具;\r\n移动端页面采用 <em>HTML5</em>  +  <em>CSS3</em>  标准实现。\r\n\r\n### 使用到的开源项目:\r\n- [Spring Framework](http://spring.io/) famework\r\n- [MyBatis](http://www.mybatis.org/mybatis-3/) persistence framework\r\n- [jQuery](http://jquery.com) \r\n- [Less](http://lesscss.org/)\r\n- [Font Awesome](http://www.bootcss.com/p/font-awesome/)\r\n- [AngularJS](https://angularjs.org/)\r\n- [angular-loading-bar.js](https://github.com/chieffancypants/angular-loading-bar)\r\n- [marked.js](https://github.com/chjj/marked)\r\n- [highlight.js](https://highlightjs.org/)\r\n- [gulp](http://gulpjs.com/)\r\n\r\n### 开发环境:\r\n- **JDK:** java version \"1.7.0_80\" \r\n- **JVM:** HotSpot(TM) 64-Bit Server VM (build 24.80-b11, mixed mode)\r\n- **MySQL:** 5.6.24\r\n- **IDE:** IntelliJ IDEA 15.0.2\r\n\r\n## 安装使用\r\n\r\n**Completed**:\r\n\r\n* 首页 (PC端和移动端)\r\n* 归档 (PC端和移动端)\r\n* 分类 (PC端和移动端)\r\n* 关于 (PC端和移动端)\r\n* 文章管理\r\n\r\n**TODO List:**\r\n* 增加日志记录\r\n* 读书\r\n* 日记\r\n* 单元测试覆盖(coveralls)\r\n\r\n**使用方式:**\r\n\r\n1. 下载 [PBlog.war](https://github.com/penglongli/PBlog/releases/download/0.1.0/PBlog.war);\r\n2. 下载 pblog.sql(见源码目录)， 创建数据库: pblog, 导入pblog.sql;\r\n3. 移动PBog.war重命名为ROOT.war，并移动至tomcat/webapps目录下，启动tomcat。 启动后webapps目录下会生成ROOT目录;\r\n4. 修改**ROOT/WEB-INF/classes/properties/pblog-local.properties**文件中的数据库账户密码\r\n5. 重启tomcat，打开浏览器访问。\r\n6. 文章管理uri: **/manage/article/list**(由于使用nginx作为登录，所以并未写用户登录模块。所以未配置nginx的用户使用的时候是可以自由访问的)\r\n\r\n*具体使用请参见:* [PBlog-releases](https://github.com/penglongli/PBlog/releases/)\r\n\r\n## 项目构建\r\n**NOTE:** \r\n\r\n* [Maven 3+](http://maven.apache.org/download.cgi)\r\n* 添加Maven的bin路径到Path中\r\n\r\nclone项目源码后，在项目根目录执行:\r\n```\r\nmvn package -DskipTests\r\n```\r\n\r\n## 交流贡献\r\n\r\n源码下载、使用、阅读、修改请参见 [wiki文档](https://github.com/penglongli/PBlog/wiki)\r\n\r\n## 版权\r\nThis project is open-sourced under [Apache License 2.0](http://www.apache.org/licenses/LICENSE-2.0)',93246051,'2016-05-04 19:43:36','2016-05-04 19:43:36',93246051,'',0,1,'','');
